import './App.css';
import {BrowserRouter as Router, Route} from "react-router-dom";

import { EnterName } from './components/EnterName';
import { ProductList } from './components/ProductList';
import { AddProductNumber } from './components/AddProductNumber';
import { AddProductName } from './components/AddProductName';
import { Welcome } from './components/Welcome';
import { Page1 } from './lab10/Page1';
import { ShowAccounts } from './components/ShowAccounts';
import { Page2 } from './lab10/Page2';
import { BookList } from './lab10/BookList';
import { Book2List } from './lab10/Book2List';
import { useState } from 'react';
import { Book2Add } from './lab10/Book2Add';

function App() {
  const [books, setBooks] = useState([]);
  const [books2, setBooks2] = useState([]);

  return (
      <div>
        <Router>
          <Route exact path={["/"]} component={EnterName} />
          <Route path="/productlist" component={ProductList} />
          <Route path="/addproductnumber" component={AddProductNumber} />
          <Route path="/welcome" component={Welcome} />
          <Route path="/showaccounts" component={ShowAccounts} />
          <Route path="/page1" component={Page1} />
          <Route path="/page2" component={Page2} />
          <Route path="/booklist" component={BookList} />

          <Route path="/book2list" 
            render={(props) => (
              <Book2List {...props} books={books} setBooks={setBooks} 
              books2={books2} setBooks2={setBooks2} 
              />
            )}
            />
          <Route path="/book2add"
            render={(props) => (
              <Book2Add {...props} books={books} setBooks={setBooks} 
              books2={books2} setBooks2={setBooks2} 
              />
            )} 
            />

        </Router>
      </div>
  );
}
export default App;
